import './App.css';
import { Route, Switch } from 'react-router';
import Home from './pages/Home/Home'

function App() {
  return (
    <Switch>
      <Route exact path='/'></Route>
      <Route path='/home'></Route>
      <Route path='/'></Route>
    </Switch>
  );
}

export default App;
